import React, { useEffect, useState } from 'react';




function Shop(){

    const [content , setContent] = useState([])

    useEffect(()=>{

        fetch('/api/note/')
        .then(res => res.json())
        .then(data => setContent(data))
        .catch(err =>  setContent([]));

    },[]);




    return(
        <div class="bg-slate-800">
            
            <div class="text-center py-24">
                <h1 class="text-2xl text-white  font-light">Practice 2</h1>
                
                <p class="text-white">

                    {content.map(content => (
                        <li key={content.id_note}>
                                {content.titolo} '-----' {content.contenuto}
                        </li>
                    ))} 

                </p>
               
            </div>
     
        </div>
    )

}

export default Shop;
